"""
relative function
"""
def copy_graph(graph):
    """
    Make a copy of a graph
    """
    new_graph = {}
    for node in graph:
        new_graph[node] = set(graph[node])
    return new_graph

def delete_node(ugraph, node):
    """
    Delete a node from an undirected graph
    """
    neighbors = ugraph[node]
    ugraph.pop(node)
    for neighbor in neighbors:
        ugraph[neighbor].remove(node)
    
def targeted_order(ugraph):
    """
    Compute a targeted attack order consisting of nodes of maximal degree
    Returns: A list of nodes
    """
    # copy the graph
    new_graph = copy_graph(ugraph)
    
    order = []    
    while len(new_graph) > 0:
        max_degree = -1
        for node in new_graph:
            if len(new_graph[node]) > max_degree:
                max_degree = len(new_graph[node])
                max_degree_node = node
        
        neighbors = new_graph[max_degree_node]
        new_graph.pop(max_degree_node)
        for neighbor in neighbors:
            new_graph[neighbor].remove(max_degree_node)

        order.append(max_degree_node)
    return order
    
    
def fast_targeted_order(ugraph):
    """
    Compute a targeted attack order consisting of nodes of maximal degree
    Returns: A list of nodes
    """
    degreeSet = {}
    for node in ugraph:
        degreeSet[node] = set()
    for node in ugraph:
        degree = len(ugraph[node])
        degreeSet[degree].add(node)
    
    order = []
    i = 0
    for k in range(len(ugraph)-1,-1,-1):
        while len(degreeSet[k]) > 0:
            u = degreeSet[k].pop()
            for node in ugraph[u]:
                degree = len(ugraph[node])
                degreeSet[degree].remove(node)
                degreeSet[degree-1].add(node)
            order.append(u)
            i += 1
            delete_node(ugraph, u)
    return order           
        
        
# class for implementing efficient version of UPA algorithm
import random
class UPATrial:
    """
    Simple class to encapsulate optimizated trials for the UPA algorithm
    
    Maintains a list of node numbers with multiple instance of each number.
    The number of instances of each node number are
    in the same proportion as the desired probabilities
    
    Uses random.choice() to select a node number from this list for each trial.
    """

    def __init__(self, num_nodes):
        """
        Initialize a UPATrial object corresponding to a 
        complete graph with num_nodes nodes
        
        Note the initial list of node numbers has num_nodes copies of
        each node number
        """
        self._num_nodes = num_nodes
        self._node_numbers = [node for node in range(num_nodes) for dummy_idx in range(num_nodes)]


    def run_trial(self, num_nodes):
        """
        Conduct num_nodes trials using by applying random.choice()
        to the list of node numbers
        
        Updates the list of node numbers so that each node number
        appears in correct ratio
        
        Returns:
        Set of nodes
        """
        
        # compute the neighbors for the newly-created node
        new_node_neighbors = set()
        for _ in range(num_nodes):
            new_node_neighbors.add(random.choice(self._node_numbers))
        
        # update the list of node numbers so that each node number 
        # appears in the correct ratio
        self._node_numbers.append(self._num_nodes)
        for dummy_idx in range(len(new_node_neighbors)):
            self._node_numbers.append(self._num_nodes)
        self._node_numbers.extend(list(new_node_neighbors))
        
        #update the number of nodes
        self._num_nodes += 1
        return new_node_neighbors

        
def make_complete_graph(num_nodes):
	"""
	return complete graph by setting node numbers
	"""
	graph = {}
	if num_nodes>0:
		for node in range(0,num_nodes):
			array = []
			for number in range(0,num_nodes):
				if number != node:
					array.append(number)
			graph[node] = set(array)
	return graph	

