"""
Short example of creating a legend in matplotlib
"""
import matplotlib.pyplot as plt
def legend_example():
    """
    plot as example with two curves with legends
    """
    xvals= [i for i in range(1240)]
    yvals1 = cn_resilience
    yvals2 = er_resilience
    yvals3 = upa_resilience
    
    fig = plt.figure()
    ax = fig.add_subplot(111)
    ax.set_title('resilience for all three graphs')
    ax.set_xlabel('attack node')
    ax.set_ylabel('resilience')
    
    ax.plot(xvals,yvals1, '-b', label='computer network')
    ax.plot(xvals,yvals2, '-r', label='ER (p=0.002)')
    ax.plot(xvals,yvals3, '-y', label='UPA (m=5)')
    ax.legend(loc='upper right')
    
    plt.show()
    
legend_example()
